import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';
import {StyleSheet, css} from 'aphrodite';
import styled, { keyframes } from 'styled-components';




class App extends Component {
  render() {
    return (
      <body className = {css(styles.body)}>
      <p className = {css(styles.FadeAnimations)}> Welcome!</p>
      <div className = {css(styles.FadeAnimations)}>
             <form action="/action_page.php">
               <label for="fname">Username</label>
               <input type="text" id="fname" name="username" placeholder="Username"></input>

               <label for="first">First Food Item</label>
               <input type="text" id="first" name="lastname" placeholder="Your first time!"></input>

               <label for="second">Second Food Item</label>
               <input type="text" id="second" name="lastname" placeholder="Your second item!"></input>

               <label for="third">Third Food Item</label>
               <input type="text" id="third" name="lastname" placeholder="Your third item!"></input>

               <label for="fourth">Fourth Food Item</label>
               <input type="text" id="fourth" name="lastname" placeholder="Your fourth item!"></input>

               <label for="fifth">Fifth Food Item</label>
               <input type="text" id="fifth" name="lastname" placeholder="Your fifth item!"></input>

               <input type="submit" value="Submit"></input>
           </form>
      </div>
   </body>
    );
  }
}


const styles = StyleSheet.create({
  body: {
    backgroundColor: 'black',
  }, 

  FadeAnimations: {
  animationName: 'fadein',
  animationDuration: '3s',
  textAlign: 'center',
  color: 'white', 
  fontSize: '80px', 
  width: '100%', 
  padding: '20px', 
},

 div: {

 },

 input : {
  width: '100%',
  padding: '12px 20px',
  margin: '8px 0',
  display: 'inline-block',
  border: '1px solid #ccc',
  borderRadius: '4px',
  boxSizing: 'border-box',

 }, 




})

export default App;
